sys_variable_value.value:
(function execute(inputs, outputs) {
  outputs.webhook_model = {};
  outputs.webhook_model.name = inputs.webhook_name;
  outputs.webhook_model.description = inputs.description;
  outputs.webhook_model.url = inputs.webhook_url;
  outputs.webhook_model.headers = inputs.headers;
})(inputs, outputs);

